import React from "react";
import Navbar from "react-bootstrap/Navbar"

function Nav() {

    return(
    <Navbar bg="dark" variant="dark">
        <Navbar.Brand href="#home">
            <img
                alt="The Office Logo"
                src="https://d1yjjnpx0p53s8.cloudfront.net/styles/logo-thumbnail/s3/0018/0890/brand.gif?itok=h3ZAhbP2"
                width="30"
                height="30"
                className="d-inline-block align-top"
            />{' '}
      The Michael Scott Memory Game
    </Navbar.Brand>

    <Navbar.Text className = "currentScore justify-content-end">Current Score: </Navbar.Text>
    <Navbar.Text className = "highScore justify-content-end">High Score: </Navbar.Text>
    </Navbar>
    )
}

export default Nav;
